app.modals.SmsVerificationModal=function(){var e,i=abp.services.app.profile,o=null;this.init=function(n){var a=(e=n).getModal();(o=a.find("form[name=SmsVerificationModalForm]")).validate(),a.find("#verifyButton").click(function(){if(o.valid()){var n=o.serializeFormToObject();n.phoneNumber=$("#PhoneNumber").val(),i.verifySmsCode(n).done(function(){$("#savedPhoneNumber").val($("#PhoneNumber").val()),$("#isPhoneNumberConfirmed").val(!0),e.setResult(null),e.close()})}})}};